import Box from '@mui/material/Box';
import Tab from '@mui/material/Tab';
import TabContext from '@mui/lab/TabContext';
import TabList from '@mui/lab/TabList';
import TabPanel from '@mui/lab/TabPanel';
import { useState } from 'react';
import { TextField } from '@mui/material';

const Register = () => {

    const [ value, setValue ] = useState('1');

    const handleChange = (event, newValue) => {
        setValue(newValue);
    }

    return (
        <div className='container'>
            <Box sx={{ width: '100%', typography: 'body1' }}>
                <TabContext value={value}>
                    <Box sx={{ borderBottom: 1, borderColor: 'divider' }}>
                    <TabList onChange={handleChange} aria-label="lab API tabs example">
                        <Tab label="Register" value="1" />
                        <Tab label="Sign In" value="2" />
                    </TabList>
                    </Box>
                    <TabPanel value="1">
                        <TextField id='outlined-basic' label="Username" variant='outlined' sx={{ width: '50%', mb: '2rem' }}/><br/>
                        <TextField id='outlined-basic' label="Password" type='password' variant='outlined' sx={{ width: '50%', mb: '2rem'}}/>
                    </TabPanel>
                    <TabPanel value="2">Item Two</TabPanel>
                </TabContext>
            </Box>
        </div>
    );
}

export default Register;
